import React from 'react';
import { View, Text } from 'react-native'
import { Entypo } from '@expo/vector-icons';
import { FontAwesome } from '@expo/vector-icons';

function Bottom(props) {
    return (
        <View style={{
            height: 80,
            backgroundColor: 'white',
            flexDirection: 'row',
            borderRadius:20,

        }}>
        <View style={{
                flex: 3,
                backgroundColor: 'red',
                marginBottom:30,
                position:'absolute',
                zIndex:40,
                bottom:120,
                left:20
            }}>

            </View>
            <View style={{
                flex: 3,

                alignItems: 'center',

            }}>
                <Entypo style={{
                    marginTop: 10,
                }} name="location" size={35} color='#1C2348' />
                <Text style={{
                    color: '#1C2348'
                }}>
                    Location
                </Text>
            </View>
            
            <View style={{
                flex: 3,
                alignItems: 'center',
            }}>
                <FontAwesome style={{
                    marginTop: 10,
                }} name="user" size={35} color='#1C2348' />
                <Text style={{
                    color: '#1C2348'
                }}>
                    Profile
                </Text>

            </View>


        </View>

    );
}

export default Bottom;
